import React, { useState } from "react";

const Search = () => {
  const [img, setImg] = useState();
  const inputEvent = (event) => {
    let data = event.target.value;
    console.log(data);
  };

  return (
    <>
      <div>
        <input
          type="text"
          placeholder="Type Anything.."
          onChange={inputEvent}
          value="img"
        />
      </div>
    </>
  );
};

export default Search;
